(85, 29, ':nhs-suppliers.jpg', 'nhs-suppliers.jpg'),
(85, 30, 'Corrie Williams', 'Corrie Williams'),
(85, 31, '<p>The NHS IT market expected to&nbsp;<a href="https://www.digitalhealth.net/2018/05/digital-health-intelligence-forecast-nhs-it-4bn-2022/">reach &pound;4bn by 2022</a>&nbsp;and yet despite market opportunities in abundance, it is a turbulent commercial landscape for IT suppliers.</p>\r\n\r\n<p>Some suppliers are making great strides through funding programmes such as the&nbsp;<a href="https://www.england.nhs.uk/digitaltechnology/info-revolution/exemplars/acute-global-digital-exemplars/">Global Digital Exemplars (GDE) scheme</a>&nbsp;where they will benefit economically from government investment via their NHS customers and potentially win new contracts as &lsquo;Fast Followers&rsquo;.</p>\r\n\r\n<p>But despite this success, I hear some suppliers are still waiting to be paid for services incurred as part of the programme.</p>\r\n\r\n<p>Then there are the suppliers that fall outside these programmes, who rely on winning individual contracts or tenders. They face a real competitive threat and will have to adjust their strategies to ensure the pipeline remains as stable as possible.</p>\r\n\r\n<p>And new market entrants? The NHS IT market is as attractive as it is difficult to secure sales. Faced with the chicken and egg scenario of needing a first reference site to generate an initial sale, seldom do you see short-term gains.</p>\r\n\r\n<p>All these scenarios highlight a major issue for suppliers at the moment: cash flow.</p>\r\n\r\n<h3>Impact health IT marketers</h3>\r\n\r\n<p>And what is often the first thing to be cut in times of austerity? Marketing.</p>\r\n\r\n<p>It&rsquo;s always a tense moment when you are sitting in front of your CEO or finance director waiting to find out how much marketing budget you will get in the next financial year.</p>\r\n\r\n<p>And then they deliver the bad news. Budget is down next year. So, what should you prioritise? Which activities do you drop?</p>\r\n\r\n<p>It&rsquo;s a tough choice. There&rsquo;s not many marketers that would argue about the value of integrated marketing campaigns and investing in multiple channels to reach your audiences effectively.</p>\r\n\r\n<p>For example, some of the most successful sales acceleration campaigns we&rsquo;ve delivered at&nbsp;<a href="https://www.elemental-solutions.co.uk/">Elemental</a>&nbsp;have been boosted by some brilliant press coverage to generate awareness and build credibility, making the conversation with a prospect that bit easier.</p>\r\n\r\n<p>But, as the saying goes, &lsquo;needs must&rsquo;. The biggest need in times of austerity is revenue.</p>\r\n\r\n<h3>Bang for your buck</h3>\r\n\r\n<p>It&rsquo;s widely acknowledged that the further you go up the sales pipeline, the more difficult marketing is to measure. The metrics for measuring brand presence are often hotly debated among PR circles (reach vs. engagement, anyone?), but what you cannot dispute is the clear return on investment for sales acceleration activity.</p>\r\n\r\n<p>Sales acceleration &ndash; If you are not aware &ndash; is the process of segmenting your market, prospecting targets, generating leads and gaining qualified appointments to increase the pace in which you hit your sales targets.</p>\r\n\r\n<p>It outstrips ROI performance of communications activities such as PR, social media, advertising, events if you are looking for a rapid assessment of your sales pipeline.</p>\r\n\r\n<p>This is a particularly attractive approach when selling technology to the NHS where procurement cycles can be long, protracted and require huge investment.</p>\r\n\r\n<h3>How, and why now?</h3>\r\n\r\n<p>Spend on NHS IT is going up with major opportunities for services such as cloud, interoperability, cyber security and clinical software. Despite cash flow challenges, the market is primed for new and established technology solutions to support the NHS&rsquo; wider digital ambitions, such as a paperless working.</p>\r\n\r\n<p>My mantra has always been to &lsquo;market through the tough times&rsquo;, but to do that you need to be savvy about your approach by identifying high value segments and going direct with your sales messages.</p>\r\n\r\n<p>Pitching to the NHS is not easy. It is a complex purchasing machine and there are often multiple stakeholders in the NHS IT procurement process &ndash; crossing clinical, operational, financial and technology backgrounds &ndash; all with differing priorities and needs.</p>\r\n\r\n<p>They are also very busy people working in an under-resourced institution &ndash; you only have to look at the media headlines.</p>\r\n\r\n<p>Finding out who they are, their pain points, and how your solution can solve their needs is key to sales acceleration.</p>\r\n\r\n<p>You have one shot at impressing these people. Being able to identify who to target, how to contact them and what to say is essential to making sales acceleration a success.</p>\r\n\r\n<p>Throughout my 20+ years developing contacts and relationships with the people driving NHS IT transformation, I can hand on heart, say it&rsquo;s something of an art form. And it works.</p>\r\n\r\n<p>By using our vast experience in the NHS IT market, we have planned and executed sales acceleration campaigns that have seen our clients get appointments with 20% of their target audience in just three months.</p>\r\n\r\n<p>The real winners however, invest in sales acceleration more strategically and in 12 months can see this percentage rise to 45%. Just imagine that &ndash; face-to-face appointments with a whopping 45% of your total market in one year.</p>\r\n\r\n<h3>My pitch</h3>\r\n\r\n<p>The team here at&nbsp;<a href="https://www.weareelemental.uk/">Elemental</a>&nbsp;are an experienced bunch of Sales Development Specialists (SDS) and marketing veterans, focused on delivering exceptional results in niched sectors. We&rsquo;ve been blowing the trumpet for sales acceleration for nearly a decade now and have made some sweet music in the process &ndash; our clients will vouch for that.</p>\r\n\r\n<p>If you want the opportunity to get in front of decision-makers across the NHS, drop us a line at 0808 168 6426 or on:&nbsp;hello@weareelemental.uk</p>\r\n', 'The NHS IT market expected to reach £4bn by 2022 and yet despite market opportunities in abundance, it is a turbulent commercial landscape for IT suppliers. Some suppliers are making great strides through funding programmes such as the Global Digital Exemplars (GDE) scheme where they will benefit economically from government investment via their NHS customers and potentially win new contracts as ‘Fast Followers’. But despite this success, I hear some suppliers are still waiting to be paid for services incurred as part of the programme. Then there are the suppliers that fall outside these programmes, who rely on winning individual contracts or tenders. They face a real competitive threat and will have to adjust their strategies to ensure the pipeline remains as stable as possible. And new market entrants? The NHS IT market is as attractive as it is difficult to secure sales. Faced with the chicken and egg scenario of needing a first reference site to generate an initial sale, seldom do you see short-term gains. All these scenarios highlight a major issue for suppliers at the moment: cash flow. Impact health IT marketers And what is often the first thing to be cut in times of austerity? Marketing. It’s always a tense moment when you are sitting in front of your CEO or finance director waiting to find out how much marketing budget you will get in the next financial year. And then they deliver the bad news. Budget is down next year. So, what should you prioritise? Which activities do you drop? It’s a tough choice. There’s not many marketers that would argue about the value of integrated marketing campaigns and investing in multiple channels to reach your audiences effectively. For example, some of the most successful sales acceleration campaigns we’ve delivered at Elemental have been boosted by some brilliant press coverage to generate awareness and build credibility, making the conversation with a prospect that bit easier. But, as the saying goes, ‘needs must’. The biggest need in times of austerity is revenue. Bang for your buck It’s widely acknowledged that the further you go up the sales pipeline, the more difficult marketing is to measure. The metrics for measuring brand presence are often hotly debated among PR circles (reach vs. engagement, anyone?), but what you cannot dispute is the clear return on investment for sales acceleration activity. Sales acceleration – If you are not aware – is the process of segmenting your market, prospecting targets, generating leads and gaining qualified appointments to increase the pace in which you hit your sales targets. It outstrips ROI performance of communications activities such as PR, social media, advertising, events if you are looking for a rapid assessment of your sales pipeline. This is a particularly attractive approach when selling technology to the NHS where procurement cycles can be long, protracted and require huge investment. How, and why now? Spend on NHS IT is going up with major opportunities for services such as cloud, interoperability, cyber security and clinical software. Despite cash flow challenges, the market is primed for new and established technology solutions to support the NHS’ wider digital ambitions, such as a paperless working. My mantra has always been to ‘market through the tough times’, but to do that you need to be savvy about your approach by identifying high value segments and going direct with your sales messages. Pitching to the NHS is not easy. It is a complex purchasing machine and there are often multiple stakeholders in the NHS IT procurement process – crossing clinical, operational, financial and technology backgrounds – all with differing priorities and needs. They are also very busy people working in an under-resourced institution – you only have to look at the media headlines. Finding out who they are, their pain points, and how your solution can solve their needs is key to sales acceleration. You have one shot at impressing these people. Being able to identify who to target, how to contact them and what to say is essential to making sales acceleration a success. Throughout my 20+ years developing contacts and relationships with the people driving NHS IT transformation, I can hand on heart, say it’s something of an art form. And it works. By using our vast experience in the NHS IT market, we have planned and executed sales acceleration campaigns that have seen our clients get appointments with 20% of their target audience in just three months. The real winners however, invest in sales acceleration more strategically and in 12 months can see this percentage rise to 45%. Just imagine that – face-to-face appointments with a whopping 45% of your total market in one year. My pitch The team here at Elemental are an experienced bunch of Sales Development Specialists (SDS) and marketing veterans, focused on delivering exceptional results in niched sectors. We’ve been blowing the trumpet for sales acceleration for nearly a decade now and have made some sweet music in the process – our clients will vouch for that. If you want the opportunity to get in front of decision-makers across the NHS, drop us a line at 0808 168 6426 or on: hello@weareelemental.uk'),
(86, 29, ':nhs-sales-team.jpg', 'nhs-sales-team.jpg'),
(86, 30, 'Vicky Dingle', 'Vicky Dingle'),
(86, 31, '<p>You&rsquo;ve got enough battle wounds to know that selling to the NHS can be gruelling.</p>\r\n\r\n<p>Rifling through procurement frameworks, writing tender bids and applying for funding streams are a long process to engaging with your target market.</p>\r\n\r\n<p>The simple fact is that finding and prospecting technology buyers in the NHS puts a massive strain &ndash; time, money, motivation &ndash; on any sales team.</p>\r\n\r\n<p>What you would give for a straight pitch to an IT director that wanted (and could purchase) an IT solution just like yours. You can smell the sales bonus.</p>\r\n\r\n<h4><strong>Stakeholder shift&nbsp;</strong></h4>\r\n\r\n<p>But there are more purchase stakeholders in the NHS IT market than ever before, making your job harder and more time-consuming.</p>\r\n\r\n<p>Some reasons are:</p>\r\n\r\n<ul>\r\n	<li>Pooled or split budgets from integrated care initiatives</li>\r\n	<li>Price-sensitive NHS providers spreading risk by involving more people in the purchasing process</li>\r\n	<li>Nurses are increasingly playing a more active role in tech deployments</li>\r\n	<li>Clinical engagement is higher on the agenda</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>The last point resonates with us at&nbsp;<a href="https://www.weareelemental.uk/">Elemental</a>&nbsp;as we&rsquo;ve seen a rise in demand for marketing data targeting clinical-based job titles.</p>\r\n\r\n<p>Clearly clinicians are playing a more active and high-profile role in the purchase cycle, and not just those at board-level. Many enthusiastic junior clinicians are leading or influencing technology projects of all sizes.</p>\r\n\r\n<h4><strong>Job titles aren&rsquo;t enough&nbsp;</strong></h4>\r\n\r\n<p>And therein lies a major challenge for your sales and marketing data build. Targeting prospects by job titles is not enough to achieve your sales targets.</p>\r\n\r\n<p>Whilst it&rsquo;s a good starting point to segmenting your decision-making unit, no two job roles are the same, just as no two NHS trusts are the same.</p>\r\n\r\n<p>For example, two chief nursing information officers will have differing responsibilities and priorities. One may be contributing to a major EPR procurement, the other may have a hands-on approach to installing an e-observations solution.</p>\r\n\r\n<p>The skill, from a sales viewpoint, is to find out what requirements they have, how this fits into their organisational and personal objectives, and what available resource they have.</p>\r\n\r\n<p>Another useful example is identifying who in an NHS trust is responsible for apps. We have found that some are within operations teams, some come under a &lsquo;software IT applications&rsquo; banner and others are within an individual ward or department.</p>\r\n\r\n<p>In short, you need to have the correct contact details and speak to the right people to maximise your sales efforts.</p>\r\n\r\n<h4><strong>Painting a bigger picture&nbsp;</strong></h4>\r\n\r\n<p>Many sales and business development teams approach us to help them build a predictable sales pipeline and grow their business.</p>\r\n\r\n<p>The most savvy of those sales people, like you, recognise that they need an accurate marketing data &ndash; name, organisation, job title, contact details &ndash; but layered with market intelligence, to really help focus their energies and hit targets.</p>\r\n\r\n<p>We build dynamic databases turbocharged with information like system data, contract end dates, and notes on who is the best person to target and why, to help prioritise sales engagement and deliver appointments faster. It paints a bigger, more in-depth picture for your sales process.</p>\r\n\r\n<p>If you are being let down by outdated, erroneous B2B marketing contact data and want support to build your pipeline, get in touch on 0808 168 6426 or on:&nbsp;<a href="mailto:hello@weareelemental.uk">hello@weareelemental.uk</a></p>\r\n', 'You’ve got enough battle wounds to know that selling to the NHS can be gruelling. Rifling through procurement frameworks, writing tender bids and applying for funding streams are a long process to engaging with your target market. The simple fact is that finding and prospecting technology buyers in the NHS puts a massive strain – time, money, motivation – on any sales team. What you would give for a straight pitch to an IT director that wanted (and could purchase) an IT solution just like yours. You can smell the sales bonus. Stakeholder shift  But there are more purchase stakeholders in the NHS IT market than ever before, making your job harder and more time-consuming. Some reasons are: Pooled or split budgets from integrated care initiatives Price-sensitive NHS providers spreading risk by involving more people in the purchasing process Nurses are increasingly playing a more active role in tech deployments Clinical engagement is higher on the agenda   The last point resonates with us at Elemental as we’ve seen a rise in demand for marketing data targeting clinical-based job titles. Clearly clinicians are playing a more active and high-profile role in the purchase cycle, and not just those at board-level. Many enthusiastic junior clinicians are leading or influencing technology projects of all sizes. Job titles aren’t enough  And therein lies a major challenge for your sales and marketing data build. Targeting prospects by job titles is not enough to achieve your sales targets. Whilst it’s a good starting point to segmenting your decision-making unit, no two job roles are the same, just as no two NHS trusts are the same. For example, two chief nursing information officers will have differing responsibilities and priorities. One may be contributing to a major EPR procurement, the other may have a hands-on approach to installing an e-observations solution. The skill, from a sales viewpoint, is to find out what requirements they have, how this fits into their organisational and personal objectives, and what available resource they have. Another useful example is identifying who in an NHS trust is responsible for apps. We have found that some are within operations teams, some come under a ‘software IT applications’ banner and others are within an individual ward or department. In short, you need to have the correct contact details and speak to the right people to maximise your sales efforts. Painting a bigger picture  Many sales and business development teams approach us to help them build a predictable sales pipeline and grow their business. The most savvy of those sales people, like you, recognise that they need an accurate marketing data – name, organisation, job title, contact details – but layered with market intelligence, to really help focus their energies and hit targets. We build dynamic databases turbocharged with information like system data, contract end dates, and notes on who is the best person to target and why, to help prioritise sales engagement and deliver appointments faster. It paints a bigger, more in-depth picture for your sales process. If you are being let down by outdated, erroneous B2B marketing contact data and want support to build your pipeline, get in touch on 0808 168 6426 or on: hello@weareelemental.uk'),
(87, 29, ':marketintel.jpg', 'marketintel.jpg'),
(87, 30, 'Corrie Williams', 'Corrie Williams'),
(87, 31, '<p>Adding market intelligence to your B2B sales data is surprisingly underestimated by NHS IT suppliers, and I&rsquo;ll tell you why.</p>\r\n\r\n<p><em>(Off topic but relevant):</em>&nbsp;Would you play darts without a dartboard? No.</p>\r\n\r\n<p>This is because you need to know where to aim and what you want to achieve to really focus your efforts.</p>\r\n\r\n<p>I&rsquo;ve come across some NHS IT sales teams who simply take a blanket approach to cold calling prospects hoping they are qualified, have a purchase requirement and are ready to buy.</p>\r\n\r\n<p><em>Good luck with that.</em></p>\r\n\r\n<p>I am not too sure why these teams do not invest more in market intelligence to inform their strategies and engagement exercises &ndash; maybe it&rsquo;s seen as a &lsquo;nice to have&rsquo; &ndash; but I believe it&rsquo;s an essential element of your B2B sales data.</p>\r\n\r\n<p>This is especially so in the NHS. It&rsquo;s unlike any other market, with an eco-system of buyers guided by national, local and co-shared visions and budgets. You need direction.</p>\r\n\r\n<p>This is where market intelligence can help. Accessing information on which systems are deployed at each local NHS trust or organisation, contract end dates, their IT strategies, procurement intentions, and key contacts (buyers and influencers) can dramatically increase your chances of setting sales appointments.</p>\r\n\r\n<p>Here&rsquo;s some ways that market intelligence can be used to great effect</p>\r\n\r\n<h4><strong>1 Define your market</strong></h4>\r\n\r\n<p>Work out how large or small your addressable market is and make informed decisions on which segments to target first. You will waste less time and effort by identifying who your qualified prospects are and when they will be in a position to engage with you.</p>\r\n\r\n<h4><strong>2 Understand your prospects&rsquo; needs better&nbsp; &nbsp;&nbsp;</strong></h4>\r\n\r\n<p>Qualifying out is time well spent. Finding out the detail behind the purchase decision-making, and whether a segment is right for you, means you can exit before you invest time and money on marketing.</p>\r\n\r\n<h4><strong>3 Identify market trends and opportunities</strong></h4>\r\n\r\n<p>The commercial outlook for the NHS IT market is expected to reach a whopping &pound;4bn by 2022. Shape your sales strategy with insight into who has funding, expecting funding or is going out for tender to meet their digital aims.</p>\r\n\r\n<h4>4&nbsp;<strong>Manage resource more effectively&nbsp;&nbsp;</strong></h4>\r\n\r\n<p>Establishing a pipeline of opportunity will help you to plan ahead. Get your sales and marketing people ready to convert leads, and clear diaries for your bid and demo teams.&nbsp;<em>Top tip: don&rsquo;t pay your sales lead generators to build market intelligence data &ndash; they are two very different disciplines, and it doesn&rsquo;t make economic sense!</em></p>\r\n\r\n<h4><strong>5 Watch for competitive threats</strong></h4>\r\n\r\n<p>Assess market share and see who has relationships at which local NHS trusts or organisations. Anticipate your competitors&rsquo; next moves, and counter against them with market messages and activity.</p>\r\n\r\n<h4><strong>6 Inform PR campaigns</strong></h4>\r\n\r\n<p>As well as informing your key messages to help market differentiation, you can use feedback and comments from market intelligence activity to inform thought leadership campaigns, in turn helping to educate your market to increase profile and credibility of your brand.</p>\r\n\r\n<h4><strong>7 Build a predictable pipeline</strong></h4>\r\n\r\n<p>Many sales professionals are driven by short-term sales targets and bonuses. By investing in market intelligence, you can plan and build a pipeline for up to a year, and be confident of hitting those targets, and some.</p>\r\n\r\n<h4><strong>Why by September?&nbsp;</strong></h4>\r\n\r\n<p>Within the NHS calendar year, August is often written off as holiday season for procurements and marketing efforts mainly because purchasing decisions are delayed as members of the decision-making unit are on a sandy beach or sunny (or soggy) campsite.</p>\r\n\r\n<p>Whilst there is some truth in that, it also represents an opportunity for you and your team to re-group and assess/set your sales strategy so that you are ready for when the NHS wakes up again in September, but make sure you are armed with the right information to do this justice.</p>\r\n\r\n<h4><strong>Next steps&nbsp;</strong></h4>\r\n\r\n<p>We build one-off dynamic databases turbocharged with information like system data, contract end dates, and notes on who is the best person to target and why, to help prioritise sales engagement and deliver appointments faster.</p>\r\n\r\n<p>This service is available as an ad-hoc investment or an annual maintenance plan giving you reassurance that your data is always up-to-date and available for any campaign, whenever you need it.</p>\r\n\r\n<p>If you want a chat about how market intelligence can support your sales objectives, please call 0808 168 6426 or email&nbsp;<a href="mailto:hello@weareelemental.uk">hello@weareelemental.</a>uk</p>\r\n', 'Adding market intelligence to your B2B sales data is surprisingly underestimated by NHS IT suppliers, and I’ll tell you why. (Off topic but relevant): Would you play darts without a dartboard? No. This is because you need to know where to aim and what you want to achieve to really focus your efforts. I’ve come across some NHS IT sales teams who simply take a blanket approach to cold calling prospects hoping they are qualified, have a purchase requirement and are ready to buy. Good luck with that. I am not too sure why these teams do not invest more in market intelligence to inform their strategies and engagement exercises – maybe it’s seen as a ‘nice to have’ – but I believe it’s an essential element of your B2B sales data. This is especially so in the NHS. It’s unlike any other market, with an eco-system of buyers guided by national, local and co-shared visions and budgets. You need direction. This is where market intelligence can help. Accessing information on which systems are deployed at each local NHS trust or organisation, contract end dates, their IT strategies, procurement intentions, and key contacts (buyers and influencers) can dramatically increase your chances of setting sales appointments. Here’s some ways that market intelligence can be used to great effect 1 Define your market Work out how large or small your addressable market is and make informed decisions on which segments to target first. You will waste less time and effort by identifying who your qualified prospects are and when they will be in a position to engage with you. 2 Understand your prospects’ needs better     Qualifying out is time well spent. Finding out the detail behind the purchase decision-making, and whether a segment is right for you, means you can exit before you invest time and money on marketing. 3 Identify market trends and opportunities The commercial outlook for the NHS IT market is expected to reach a whopping £4bn by 2022. Shape your sales strategy with insight into who has funding, expecting funding or is going out for tender to meet their digital aims. 4 Manage resource more effectively   Establishing a pipeline of opportunity will help you to plan ahead. Get your sales and marketing people ready to convert leads, and clear diaries for your bid and demo teams. Top tip: don’t pay your sales lead generators to build market intelligence data – they are two very different disciplines, and it doesn’t make economic sense! 5 Watch for competitive threats Assess market share and see who has relationships at which local NHS trusts or organisations. Anticipate your competitors’ next moves, and counter against them with market messages and activity. 6 Inform PR campaigns As well as informing your key messages to help market differentiation, you can use feedback and comments from market intelligence activity to inform thought leadership campaigns, in turn helping to educate your market to increase profile and credibility of your brand. 7 Build a predictable pipeline Many sales professionals are driven by short-term sales targets and bonuses. By investing in market intelligence, you can plan and build a pipeline for up to a year, and be confident of hitting those targets, and some. Why by September?  Within the NHS calendar year, August is often written off as holiday season for procurements and marketing efforts mainly because purchasing decisions are delayed as members of the decision-making unit are on a sandy beach or sunny (or soggy) campsite. Whilst there is some truth in that, it also represents an opportunity for you and your team to re-group and assess/set your sales strategy so that you are ready for when the NHS wakes up again in September, but make sure you are armed with the right information to do this justice. Next steps  We build one-off dynamic databases turbocharged with information like system data, contract end dates, and notes on who is the best person to target and why, to help prioritise sales engagement and deliver appointments faster. This service is available as an ad-hoc investment or an annual maintenance plan giving you reassurance that your data is always up-to-date and available for any campaign, whenever you need it. If you want a chat about how market intelligence can support your sales objectives, please call 0808 168 6426 or email hello@weareelemental.uk'),
(90, 29, ':blog-medilogik.jpg', 'blog-medilogik.jpg'),
(90, 30, 'Chris Marsom', 'Chris Marsom'),
(90, 31, '<p>Medilogik&rsquo;s Endoscopy Management System (EMS) is an endoscopy reporting and imaging solution with integrated scheduling and booking to help endoscopy teams work smarter and more productively and assist in managing waiting times.&nbsp;</p>\r\n\r\n<h5>Brief</h5>\r\n\r\n<p>Faced with substantial market opportunity for its EMS solution, Medilogik asked Elemental to help upgrade its marketing materials to initially support lead generation at a key industry exhibition, and re-use for future promotional campaigns.</p>\r\n\r\n<h4>Approach</h4>\r\n\r\n<p>Elemental worked closely with Medilogik to understand how it wanted to be positioned to its target audiences before providing design recommendations and managing the print production process creating refreshed marketing collateral.</p>\r\n\r\n<h4>Results</h4>\r\n\r\n<h5>New website&nbsp;</h5>\r\n\r\n<p><img alt="Medilogik Website" src="http://localhost/elemental/cctr/uploads/image/website.jpg" style="width: 500px; height: 356px;" /></p>\r\n\r\n<h5>Collateral</h5>\r\n\r\n<h5><img alt="Medilogik Collateral" src="http://localhost/elemental/cctr/uploads/image/flyers.jpg" style="width: 500px; height: 356px;" /></h5>\r\n\r\n<h4>Client View</h4>\r\n\r\n<blockquote>\r\n<p><em>&ldquo;In competitive marketplaces such as healthcare, you often get just a few seconds to make an impression on your prospects, which is why branding is vital. I have been impressed with the team at Elemental because they understood our brand, the company&rsquo;s vision and values, and translated them all into a fresh, clean, crisp look and feel for our multiple sales and marketing channels.&rdquo;</em></p>\r\n\r\n<p>David Simpson ,&nbsp;Managing Director&nbsp;</p>\r\n</blockquote>\r\n', 'Medilogik’s Endoscopy Management System (EMS) is an endoscopy reporting and imaging solution with integrated scheduling and booking to help endoscopy teams work smarter and more productively and assist in managing waiting times.  Brief Faced with substantial market opportunity for its EMS solution, Medilogik asked Elemental to help upgrade its marketing materials to initially support lead generation at a key industry exhibition, and re-use for future promotional campaigns. Approach Elemental worked closely with Medilogik to understand how it wanted to be positioned to its target audiences before providing design recommendations and managing the print production process creating refreshed marketing collateral. Results New website  Collateral Client View “In competitive marketplaces such as healthcare, you often get just a few seconds to make an impression on your prospects, which is why branding is vital. I have been impressed with the team at Elemental because they understood our brand, the company’s vision and values, and translated them all into a fresh, clean, crisp look and feel for our multiple sales and marketing channels.” David Simpson , Managing Director '),
(91, 29, ':blog-new.jpg', 'blog-new.jpg'),
(91, 30, 'Corrie Williams', 'Corrie Williams'),
(91, 31, '<p>Despite its importance to sales and marketing campaigns, the quality of data is not treated with the same amount of scrutiny as crafting a message, getting the design nailed and reviewing a press release line-by-line.</p>\r\n\r\n<p>Truth be told, data is often an after-thought.</p>\r\n\r\n<p>It may be because prospect or contact data is not as visible as other areas of campaigns which is why it is not given the attention that it deserves.</p>\r\n\r\n<p>The other school of thought, and perhaps more likely, is that good quality data in niche sectors is particularly hard to source.</p>\r\n\r\n<p>The options?</p>\r\n\r\n<p>One common approach is to rely on in-house administrators to build databases. The drawback is that this is often an expensive personnel cost and they rarely have the industry experience to sense check whether they have found the right people to target.</p>\r\n\r\n<p>Alternatively, many sales and marketing teams buy or rent data for campaigns. If you&rsquo;ve sourced contact lists from B2B data providers you may recognise the following scenario:</p>\r\n\r\n<p>Marketing manager (MM) calls B2B data provider (DP).</p>\r\n\r\n<p>MM:&nbsp;<em>&ldquo;Hello, I&rsquo;m looking for contact details of all heads of IT, clinical or medical directors and chief clinical information officers (or variations of these job titles) at all 144 NHS acute trusts. I need names, job titles, telephone numbers and email addresses. Can you help?&rdquo;</em></p>\r\n\r\n<p><em>&nbsp;</em>DP:<em>&nbsp;&ldquo;Yes, certainly, happy to help. The cost for this is &pound;4,000. This data is under a three-month usage licence, meaning after this period you will no longer be able to use the data. I&rsquo;ll provide you with a sample database for review.&rdquo;</em></p>\r\n\r\n<p><em>&nbsp;</em><em>MM: &ldquo;Many thanks. I have received the database and everything looks great. Happy to approve the quote.&rdquo;&nbsp;</em></p>\r\n\r\n<p>One day later&hellip;</p>\r\n\r\n<p>*Receives full database and notices gaps and duplicate records*</p>\r\n\r\n<p>**Starts campaign and notices multiple bounce-backs from emails**</p>\r\n\r\n<p>***MM puts head in hands knowing he will receive wrath of sales team***</p>\r\n\r\n<p>It&rsquo;s common for purchased databases to have up to 50% email addresses missing or incorrect. Part of the reason is that NHS trusts are migrating employee email addresses over from an individual trust domain to a simpler @nhs.net&nbsp;account.</p>\r\n\r\n<p>But unfortunately, variations exist meaning it is challenging for B2B data providers to research and supply this information to customers. How do you track and make sure that you have the right email address for IT director Joe Bloggs?</p>\r\n\r\n<p><a href="mailto:Joe.Bloggs@nhs.net">Joe.Bloggs@nhs.net</a>&nbsp;&ndash; looks like this is the one?</p>\r\n\r\n<p><a href="mailto:Bloggs.Joe@nhs.net">Bloggs.Joe@nhs.net</a>&nbsp;&ndash; it could be this?</p>\r\n\r\n<p><a href="mailto:Joe.Bloggs2@nhs.net">Joe.Bloggs2@nhs.net</a>&nbsp;&ndash; are there two Joe Bloggs? Which one do we use?</p>\r\n\r\n<p>The upshot is that your campaign will be half as effective with half the correct or available email contact data.</p>\r\n\r\n<p>And how does this affect your telemarketing activity?</p>\r\n\r\n<p>Direct dial numbers are extremely difficult pieces of information to source and they are rarely supplied by B2B data providers.</p>\r\n\r\n<p>If you or your sales team have to call a switchboard, it could ring 30 times before anyone answers, meaning a less productive day for your sales guys.</p>\r\n\r\n<p>At Elemental, we build bespoke databases and always endeavour to get a direct dial, and at the very least, source a department number (where respondents usually pick up in 2-3 rings).</p>\r\n\r\n<p>My point is that your sales team is reliant on accurate and complete information to get the cold call right, on the first attempt. And poor data will cause delays to your sales engagements.</p>\r\n\r\n<h4><strong>Have you bought a B2B contact list recently and are concerned about the validity of the data?&nbsp;</strong></h4>\r\n\r\n<p>We provide a data checking service&nbsp;to ensure your next campaign has the best chance of success.</p>\r\n\r\n<p>We know the health technology market, so we can sense check job titles, whether your targets have the appropriate responsibility for budgets and projects, as well as filling the gaps in your data.</p>\r\n\r\n<p>Get better data and improve your sales activity. Interested? Call us on 0808 168 6426 or email&nbsp;<a href="mailto:hello@weareelemental.uk">hello@weareelemental.uk</a></p>\r\n', 'Despite its importance to sales and marketing campaigns, the quality of data is not treated with the same amount of scrutiny as crafting a message, getting the design nailed and reviewing a press release line-by-line. Truth be told, data is often an after-thought. It may be because prospect or contact data is not as visible as other areas of campaigns which is why it is not given the attention that it deserves. The other school of thought, and perhaps more likely, is that good quality data in niche sectors is particularly hard to source. The options? One common approach is to rely on in-house administrators to build databases. The drawback is that this is often an expensive personnel cost and they rarely have the industry experience to sense check whether they have found the right people to target. Alternatively, many sales and marketing teams buy or rent data for campaigns. If you’ve sourced contact lists from B2B data providers you may recognise the following scenario: Marketing manager (MM) calls B2B data provider (DP). MM: “Hello, I’m looking for contact details of all heads of IT, clinical or medical directors and chief clinical information officers (or variations of these job titles) at all 144 NHS acute trusts. I need names, job titles, telephone numbers and email addresses. Can you help?”  DP: “Yes, certainly, happy to help. The cost for this is £4,000. This data is under a three-month usage licence, meaning after this period you will no longer be able to use the data. I’ll provide you with a sample database for review.”  MM: “Many thanks. I have received the database and everything looks great. Happy to approve the quote.”  One day later… *Receives full database and notices gaps and duplicate records* **Starts campaign and notices multiple bounce-backs from emails** ***MM puts head in hands knowing he will receive wrath of sales team*** It’s common for purchased databases to have up to 50% email addresses missing or incorrect. Part of the reason is that NHS trusts are migrating employee email addresses over from an individual trust domain to a simpler @nhs.net account. But unfortunately, variations exist meaning it is challenging for B2B data providers to research and supply this information to customers. How do you track and make sure that you have the right email address for IT director Joe Bloggs? Joe.Bloggs@nhs.net – looks like this is the one? Bloggs.Joe@nhs.net – it could be this? Joe.Bloggs2@nhs.net – are there two Joe Bloggs? Which one do we use? The upshot is that your campaign will be half as effective with half the correct or available email contact data. And how does this affect your telemarketing activity? Direct dial numbers are extremely difficult pieces of information to source and they are rarely supplied by B2B data providers. If you or your sales team have to call a switchboard, it could ring 30 times before anyone answers, meaning a less productive day for your sales guys. At Elemental, we build bespoke databases and always endeavour to get a direct dial, and at the very least, source a department number (where respondents usually pick up in 2-3 rings). My point is that your sales team is reliant on accurate and complete information to get the cold call right, on the first attempt. And poor data will cause delays to your sales engagements. Have you bought a B2B contact list recently and are concerned about the validity of the data?  We provide a data checking service to ensure your next campaign has the best chance of success. We know the health technology market, so we can sense check job titles, whether your targets have the appropriate responsibility for budgets and projects, as well as filling the gaps in your data. Get better data and improve your sales activity. Interested? Call us on 0808 168 6426 or email hello@weareelemental.uk'),
