(94, 28, '&quot;I have been impressed with the team at Elemental because they understood our brand, the company’s vision and values, and translated them all into a fresh, clean, crisp look and feel for our multiple sales and marketing channels.”', '&quot;I have been impressed with the team at Elemental because they understood our brand, the company’s vision and values, and translated them all into a fresh, clean, crisp look and feel for our multiple sales and marketing channels.”'),
