(97, 51, 'Founder/Managing Director', 'Founder/Managing Director'),
(97, 52, '<p>I set up Elemental to do what traditional telemarketing agencies couldn&rsquo;t &ndash; be a growth partner with industry experience that focused on building sales pipelines for clients.&nbsp;<br />\r\n<br />\r\nBusiness development has been a natural fit for me: I&rsquo;ve always been empathetic and good with prospects. Proof of this came early. I worked for a pan-European full-service marketing agency where I generated a pipeline in excess of &pound;2 million in new business every year, from cold call to close. I was just 20 years old.&nbsp;<br />\r\n<br />\r\nAt Elemental I counsel clients on sales and business development strategy, and then roll my sleeves up to support my great team to deliver impressive results for digital health and technology companies across the UK and Europe.</p>\r\n', 'I set up Elemental to do what traditional telemarketing agencies couldn’t – be a growth partner with industry experience that focused on building sales pipelines for clients.  Business development has been a natural fit for me: I’ve always been empathetic and good with prospects. Proof of this came early. I worked for a pan-European full-service marketing agency where I generated a pipeline in excess of £2 million in new business every year, from cold call to close. I was just 20 years old.  At Elemental I counsel clients on sales and business development strategy, and then roll my sleeves up to support my great team to deliver impressive results for digital health and technology companies across the UK and Europe.'),
(98, 50, ':team-placeholder-m.jpg', 'team-placeholder-m.jpg'),
(98, 51, 'Sales Development Specialist', 'Sales Development Specialist'),
(98, 52, '<p>As someone who is always looks for opportunities to engage with and connect people in my daily life, it made sense for me to do this for a living. I have done so for over 20 years now and sales acceleration has been a major part of that.&nbsp;<br />\r\n<br />\r\nAt Elemental, I focus on setting appointments and have a strong track record in this area. Being methodical, organised, experienced and good with people helps to deliver the results that clients really value.&nbsp;<br />\r\n<br />\r\nIn my personal life I like projects, I plug into self-development material to keep me sharp and I am a musician.</p>\r\n', 'As someone who is always looks for opportunities to engage with and connect people in my daily life, it made sense for me to do this for a living. I have done so for over 20 years now and sales acceleration has been a major part of that.  At Elemental, I focus on setting appointments and have a strong track record in this area. Being methodical, organised, experienced and good with people helps to deliver the results that clients really value.  In my personal life I like projects, I plug into self-development material to keep me sharp and I am a musician.'),
(99, 50, ':team-placeholder-example.jpg', 'team-placeholder-example.jpg'),
(99, 51, 'Technical Specialist', 'Technical Specialist'),
(99, 52, '<p>Rik Smithies is a clinical informatics and health architectures consultant and trainer.&nbsp;<br />\r\n<br />\r\nHe has over 25 years in the software industry, exclusively in healthcare since 1994, as a developer and architect of health systems. He has been involved with HL7 since 2002, has contributed to the published UK and international HL7 Version 3 standards and has authored many parts of the UK NHS V3 message specifications.&nbsp;<br />\r\n<br />\r\nRik is a former Chair of HL7 UK, a member of the HL7 International Standards Governance Board, and an official HL7 International FHIR tutor.&nbsp;<br />\r\n<br />\r\nAn active member and committer on the FHIR development team, in early 2013 Rik created the first UK FHIR client and demonstration server implementation.</p>\r\n', 'Rik Smithies is a clinical informatics and health architectures consultant and trainer.  He has over 25 years in the software industry, exclusively in healthcare since 1994, as a developer and architect of health systems. He has been involved with HL7 since 2002, has contributed to the published UK and international HL7 Version 3 standards and has authored many parts of the UK NHS V3 message specifications.  Rik is a former Chair of HL7 UK, a member of the HL7 International Standards Governance Board, and an official HL7 International FHIR tutor.  An active member and committer on the FHIR development team, in early 2013 Rik created the first UK FHIR client and demonstration server implementation.'),
(100, 50, ':team-placeholder-f.jpg', 'team-placeholder-f.jpg'),
(100, 51, 'Head of Data Intelligence', 'Head of Data Intelligence'),
(100, 52, '<p>I&rsquo;m responsible for data intelligence at Elemental. This means ensuring that every line of data is not only complete, but accurate too &ndash; something we take great pride in.&nbsp;<br />\r\n<br />\r\nAttention to detail has always been a bit of an asset of mine, which has certainly helped my progression from administrator to heading up a Training and Development department at a financial services company.&nbsp;<br />\r\n<br />\r\nI&rsquo;ve worked at Elemental for 8 years now and have got involved in sorts of projects &ndash; lead generation, event support, market research, database building and cleaning, in-bound call management &ndash; and the variety is great. As a person I would describe myself as methodical, dedicated, and calm under pressure, resilient, reliable and resourceful.</p>\r\n', 'I’m responsible for data intelligence at Elemental. This means ensuring that every line of data is not only complete, but accurate too – something we take great pride in.  Attention to detail has always been a bit of an asset of mine, which has certainly helped my progression from administrator to heading up a Training and Development department at a financial services company.  I’ve worked at Elemental for 8 years now and have got involved in sorts of projects – lead generation, event support, market research, database building and cleaning, in-bound call management – and the variety is great. As a person I would describe myself as methodical, dedicated, and calm under pressure, resilient, reliable and resourceful.'),
