INSERT INTO `couch_data_text` (`page_id`, `field_id`, `value`, `search_value`) VALUES
(102, 52, '<p>I look after marketing and communications at Elemental, for both our clients and as part of our own growth strategy.&nbsp;<br />\r\n<br />\r\nI&rsquo;m a chartered marketer with over 12 years&rsquo; marketing and PR experience, almost half of which has been focused on helping digital health companies build profile.&nbsp;<br />\r\n<br />\r\nI love copywriting nearly as much as a I love custard creams.</p>\r\n', 'I look after marketing and communications at Elemental, for both our clients and as part of our own growth strategy.  I’m a chartered marketer with over 12 years’ marketing and PR experience, almost half of which has been focused on helping digital health companies build profile.  I love copywriting nearly as much as a I love custard creams.'),
(104, 50, ':team-placeholder-f.jpg', 'team-placeholder-f.jpg'),
(104, 51, 'Account Director/Sales Development Specialist', 'Account Director/Sales Development Specialist'),
(104, 52, '<p>I&rsquo;m a doer that focuses on getting results and doing a great job for our clients. I&rsquo;m super organised and love post-it notes. I have a passion for learning and I&rsquo;ve enjoyed taking on retention campaigns, event organisation, sales acceleration projects, all in my stride.&nbsp;<br />\r\n<br />\r\nI get involved in all areas of account management, including briefing calls, drafting campaign documents, briefs and reports, and liaising with clients. My vast and developing experience of the healthcare IT market is supported by CQC compliance knowledge from my work as a compliance manager with the NHS.</p>\r\n', 'I’m a doer that focuses on getting results and doing a great job for our clients. I’m super organised and love post-it notes. I have a passion for learning and I’ve enjoyed taking on retention campaigns, event organisation, sales acceleration projects, all in my stride.  I get involved in all areas of account management, including briefing calls, drafting campaign documents, briefs and reports, and liaising with clients. My vast and developing experience of the healthcare IT market is supported by CQC compliance knowledge from my work as a compliance manager with the NHS.'),
(106, 50, ':team-placeholder-f.jpg', 'team-placeholder-f.jpg'),
(106, 51, 'Sales Development Specialist', 'Sales Development Specialist'),
(106, 52, '<p>My role at Elemental covers much of the sales acceleration process &ndash; from data intelligence to closing appointments. I take responsibility for building databases that are integral to successfully marketing relevant products or services or generating leads or appointments for our clients.&nbsp;<br />\r\n<br />\r\nI also hit the phones and manage emails to convert leads to appointments, which is very satisfying part of the job. Every lead generation plan we write is different so there is a lot of variety in the type of audiences we engage with on a daily basis.&nbsp;<br />\r\n<br />\r\nFrom an early age I realised my passion lied in the early stages of the sales; getting a consumer&rsquo;s attention and turning that interest into a solid lead for a client. This has led to over a decade of sales and account management experience across accountancy, manufacturing, recruitment and most recently, health technology sectors.</p>\r\n', 'My role at Elemental covers much of the sales acceleration process – from data intelligence to closing appointments. I take responsibility for building databases that are integral to successfully marketing relevant products or services or generating leads or appointments for our clients.  I also hit the phones and manage emails to convert leads to appointments, which is very satisfying part of the job. Every lead generation plan we write is different so there is a lot of variety in the type of audiences we engage with on a daily basis.  From an early age I realised my passion lied in the early stages of the sales; getting a consumer’s attention and turning that interest into a solid lead for a client. This has led to over a decade of sales and account management experience across accountancy, manufacturing, recruitment and most recently, health technology sectors.'),
(107, 50, ':team-placeholder-f.jpg', 'team-placeholder-f.jpg'),
(107, 51, 'Project Manager/Sales Development Specialist', 'Project Manager/Sales Development Specialist'),
(107, 52, '<p>I lend my hand to all areas of Elemental&rsquo;s business including data, marketing and business development.&nbsp;<br />\r\n<br />\r\nMy days are busy managing a team of technical support specialists and I am responsible for all aspects of this area including scheduling, customer liaison, scoping, project management, training and much, much more. This is a natural fit for me as I have a strong background in technical operations and call centre management.&nbsp;<br />\r\n<br />\r\nMy career highlight is managing the build and implementation of a UK accredited security operations centre, the first of its kind in India, for a major UK retailer.&nbsp;</p>\r\n', 'I lend my hand to all areas of Elemental’s business including data, marketing and business development.  My days are busy managing a team of technical support specialists and I am responsible for all aspects of this area including scheduling, customer liaison, scoping, project management, training and much, much more. This is a natural fit for me as I have a strong background in technical operations and call centre management.  My career highlight is managing the build and implementation of a UK accredited security operations centre, the first of its kind in India, for a major UK retailer. '),
(108, 50, ':team-placeholder-f.jpg', 'team-placeholder-f.jpg'),
(108, 51, 'Head of Creative Services', 'Head of Creative Services'),
(108, 52, '<p>I head up all things design and creative at Elemental. I have over 20 years of design experience providing creative, practical and effective design and print solutions for a wide variety of clients.&nbsp;<br />\r\n<br />\r\nI understand the importance of communications and I pride myself in having the creative ability and technical skills to work with clients and individuals to ensure that I achieve their objectives.&nbsp;<br />\r\n<br />\r\nMy aim is to exceed your expectations with quality of service, creative ability and dedication.</p>\r\n', 'I head up all things design and creative at Elemental. I have over 20 years of design experience providing creative, practical and effective design and print solutions for a wide variety of clients.  I understand the importance of communications and I pride myself in having the creative ability and technical skills to work with clients and individuals to ensure that I achieve their objectives.  My aim is to exceed your expectations with quality of service, creative ability and dedication.'),
(109, 50, ':team-placeholder-f.jpg', 'team-placeholder-f.jpg'),
(109, 51, 'Researcher and Data Quality Manager', 'Researcher and Data Quality Manager'),
(109, 52, '<p>I help build and cleanse data and research projects &ndash; often vital to clients&rsquo; sales and marketing strategies &ndash; here at Elemental.&nbsp;<br />\r\n<br />\r\nI am also a keen writer and produce features for online publications every week. As a person I am dedicated and passionate, I take great pride in my achievements and work. I love new challenges. I believe your never stop learning and relish the opportunity to expand my knowledge base.&nbsp;</p>\r\n', 'I help build and cleanse data and research projects – often vital to clients’ sales and marketing strategies – here at Elemental.  I am also a keen writer and produce features for online publications every week. As a person I am dedicated and passionate, I take great pride in my achievements and work. I love new challenges. I believe your never stop learning and relish the opportunity to expand my knowledge base. '),
(110, 50, ':team-placeholder-f.jpg', 'team-placeholder-f.jpg'),
(110, 51, 'Sales, Marketing and Intelligence', 'Sales, Marketing and Intelligence'),
(110, 52, '<p>With over twenty years of experience in the health, public sector and technology space and a track record in proposition development, new business development and all levels of marketing, Tara knows her stuff.&nbsp;<br />\r\n<br />\r\nHer impressive CV boasts senior positions at major healthcare IT brands including Microsoft, Dr Foster, iSOFT, ReStart and Digital Health. During her time at Dr Foster, she created and delivered a flagship consumer healthcare and political affairs vehicle, the Hospital Guide, building a customer engagement portal, negotiating strategic partnerships and developing strategies to maximise customer retention.&nbsp;<br />\r\n<br />\r\nMost recently, Tara was director of research and networks at Digital Health, where she was responsible for the delivery of the market intelligence service and the negotiation and management of strategic partnerships and affiliate marketing programmes.</p>\r\n', 'With over twenty years of experience in the health, public sector and technology space and a track record in proposition development, new business development and all levels of marketing, Tara knows her stuff.  Her impressive CV boasts senior positions at major healthcare IT brands including Microsoft, Dr Foster, iSOFT, ReStart and Digital Health. During her time at Dr Foster, she created and delivered a flagship consumer healthcare and political affairs vehicle, the Hospital Guide, building a customer engagement portal, negotiating strategic partnerships and developing strategies to maximise customer retention.  Most recently, Tara was director of research and networks at Digital Health, where she was responsible for the delivery of the market intelligence service and the negotiation and management of strategic partnerships and affiliate marketing programmes.'),
(111, 50, ':team-placeholder-m.jpg', 'team-placeholder-m.jpg'),
(111, 51, 'Clinical Consultant', 'Clinical Consultant'),
(111, 52, '<p>Dean is currently an independent clinical safety officer (CSO) working for both health organisations and healthcare IT suppliers supporting them in clinical safety management.&nbsp;<br />\r\n<br />\r\nHe has held a number of nursing positions in the NHS &ndash; including charge nurse, ward manager, admissions coordinator &ndash; before becoming a clinical lead for his trust&rsquo;s EPR project, which ignited a passion for improving safety through technology.&nbsp;<br />\r\n<br />\r\nDean joined IMS MAXIMS, a leading healthcare IT supplier, playing an important role in the development, clinical safety management and delivery of a number of functional areas mainly focused on the acute setting.</p>\r\n', 'Dean is currently an independent clinical safety officer (CSO) working for both health organisations and healthcare IT suppliers supporting them in clinical safety management.  He has held a number of nursing positions in the NHS – including charge nurse, ward manager, admissions coordinator – before becoming a clinical lead for his trust’s EPR project, which ignited a passion for improving safety through technology.  Dean joined IMS MAXIMS, a leading healthcare IT supplier, playing an important role in the development, clinical safety management and delivery of a number of functional areas mainly focused on the acute setting.'),
(112, 50, ':team-placeholder-example2.jpg', 'team-placeholder-example2.jpg'),
(112, 51, 'Sales Specialist', 'Sales Specialist'),
(112, 52, '<p>Mark is a successful sales leader, with over 25 years&rsquo; experience and a history of exceeding sales targets, growing market share and improving profit margins. He has vast knowledge and a specialist understanding of the NHS and public sector marketplace and has built an impressive network of C-level contacts within the UK and across EMEA.&nbsp;<br />\r\n<br />\r\nHaving delivered significant new business for a large number of tier one system integrators, partners, and numerous specialist suppliers, he has an in-depth understanding of the public sector buying process. Companies approach Mark for strategic advice and delivery support for a variety of commercial activity including reviewing and redesigning sales processes, market entry plans, evaluation of market performance, sales appraisals, and much more.</p>\r\n', 'Mark is a successful sales leader, with over 25 years’ experience and a history of exceeding sales targets, growing market share and improving profit margins. He has vast knowledge and a specialist understanding of the NHS and public sector marketplace and has built an impressive network of C-level contacts within the UK and across EMEA.  Having delivered significant new business for a large number of tier one system integrators, partners, and numerous specialist suppliers, he has an in-depth understanding of the public sector buying process. Companies approach Mark for strategic advice and delivery support for a variety of commercial activity including reviewing and redesigning sales processes, market entry plans, evaluation of market performance, sales appraisals, and much more.');
