(91, 'Poor data is killing your NHS sales campaigns', 'Corrie Williams Despite its importance to sales and marketing campaigns, the quality of data is not treated with the same amount of scrutiny as crafting a message, getting the design nailed and reviewing a press release line-by-line. Truth be told, data is often an after-thought. It may be because prospect or contact data is not as visible as other areas of campaigns which is why it is not given the attention that it deserves. The other school of thought, and perhaps more likely, is that good quality data in niche sectors is particularly hard to source. The options? One common approach is to rely on in-house administrators to build databases. The drawback is that this is often an expensive personnel cost and they rarely have the industry experience to sense check whether they have found the right people to target. Alternatively, many sales and marketing teams buy or rent data for campaigns. If you’ve sourced contact lists from B2B data providers you may recognise the following scenario: Marketing manager (MM) calls B2B data provider (DP). MM: “Hello, I’m looking for contact details of all heads of IT, clinical or medical directors and chief clinical information officers (or variations of these job titles) at all 144 NHS acute trusts. I need names, job titles, telephone numbers and email addresses. Can you help?”  DP: “Yes, certainly, happy to help. The cost for this is £4,000. This data is under a three-month usage licence, meaning after this period you will no longer be able to use the data. I’ll provide you with a sample database for review.”  MM: “Many thanks. I have received the database and everything looks great. Happy to approve the quote.”  One day later… *Receives full database and notices gaps and duplicate records* **Starts campaign and notices multiple bounce-backs from emails** ***MM puts head in hands knowing he will receive wrath of sales team*** It’s common for purchased databases to have up to 50% email addresses missing or incorrect. Part of the reason is that NHS trusts are migrating employee email addresses over from an individual trust domain to a simpler @nhs.net account. But unfortunately, variations exist meaning it is challenging for B2B data providers to research and supply this information to customers. How do you track and make sure that you have the right email address for IT director Joe Bloggs? Joe.Bloggs@nhs.net – looks like this is the one? Bloggs.Joe@nhs.net – it could be this? Joe.Bloggs2@nhs.net – are there two Joe Bloggs? Which one do we use? The upshot is that your campaign will be half as effective with half the correct or available email contact data. And how does this affect your telemarketing activity? Direct dial numbers are extremely difficult pieces of information to source and they are rarely supplied by B2B data providers. If you or your sales team have to call a switchboard, it could ring 30 times before anyone answers, meaning a less productive day for your sales guys. At Elemental, we build bespoke databases and always endeavour to get a direct dial, and at the very least, source a department number (where respondents usually pick up in 2-3 rings). My point is that your sales team is reliant on accurate and complete information to get the cold call right, on the first attempt. And poor data will cause delays to your sales engagements. Have you bought a B2B contact list recently and are concerned about the validity of the data?  We provide a data checking service to ensure your next campaign has the best chance of success. We know the health technology market, so we can sense check job titles, whether your targets have the appropriate responsibility for budgets and projects, as well as filling the gaps in your data. Get better data and improve your sales activity. Interested? Call us on 0808 168 6426 or email hello@weareelemental.uk '),
(101, 'Default page for globals.php * PLEASE CHANGE THIS TITLE *', '7 All Hallows Road, Paignton, Devon TQ3 1EB hello@weareelemental.uk corrie@bdmsuk.com 0808 168 6426 https://twitter.com/Elemental_BD @WeAreElemental https://www.linkedin.com/company/bdms-uk WeAreElemental '),
(97, 'Corrie Williams', 'Founder/Managing Director I set up Elemental to do what traditional telemarketing agencies couldn’t – be a growth partner with industry experience that focused on building sales pipelines for clients.  Business development has been a natural fit for me: I’ve always been empathetic and good with prospects. Proof of this came early. I worked for a pan-European full-service marketing agency where I generated a pipeline in excess of £2 million in new business every year, from cold call to close. I was just 20 years old.  At Elemental I counsel clients on sales and business development strategy, and then roll my sleeves up to support my great team to deliver impressive results for digital health and technology companies across the UK and Europe. '),
(98, 'Robert Lowe', 'Sales Development Specialist As someone who is always looks for opportunities to engage with and connect people in my daily life, it made sense for me to do this for a living. I have done so for over 20 years now and sales acceleration has been a major part of that.  At Elemental, I focus on setting appointments and have a strong track record in this area. Being methodical, organised, experienced and good with people helps to deliver the results that clients really value.  In my personal life I like projects, I plug into self-development material to keep me sharp and I am a musician. '),
(99, 'Rik Smithies', 'Technical Specialist Rik Smithies is a clinical informatics and health architectures consultant and trainer.  He has over 25 years in the software industry, exclusively in healthcare since 1994, as a developer and architect of health systems. He has been involved with HL7 since 2002, has contributed to the published UK and international HL7 Version 3 standards and has authored many parts of the UK NHS V3 message specifications.  Rik is a former Chair of HL7 UK, a member of the HL7 International Standards Governance Board, and an official HL7 International FHIR tutor.  An active member and committer on the FHIR development team, in early 2013 Rik created the first UK FHIR client and demonstration server implementation. '),
(100, 'Vicky Dingle', 'Head of Data Intelligence I’m responsible for data intelligence at Elemental. This means ensuring that every line of data is not only complete, but accurate too – something we take great pride in.  Attention to detail has always been a bit of an asset of mine, which has certainly helped my progression from administrator to heading up a Training and Development department at a financial services company.  I’ve worked at Elemental for 8 years now and have got involved in sorts of projects – lead generation, event support, market research, database building and cleaning, in-bound call management – and the variety is great. As a person I would describe myself as methodical, dedicated, and calm under pressure, resilient, reliable and resourceful. '),
(102, 'Chris Marsom', 'Head of Marketing &amp; Communications I look after marketing and communications at Elemental, for both our clients and as part of our own growth strategy.  I’m a chartered marketer with over 12 years’ marketing and PR experience, almost half of which has been focused on helping digital health companies build profile.  I love copywriting nearly as much as a I love custard creams. '),
(103, 'Default page for _about.php * PLEASE CHANGE THIS TITLE *', ''),
(104, 'Tania Spence', 'Account Director/Sales Development Specialist I’m a doer that focuses on getting results and doing a great job for our clients. I’m super organised and love post-it notes. I have a passion for learning and I’ve enjoyed taking on retention campaigns, event organisation, sales acceleration projects, all in my stride.  I get involved in all areas of account management, including briefing calls, drafting campaign documents, briefs and reports, and liaising with clients. My vast and developing experience of the healthcare IT market is supported by CQC compliance knowledge from my work as a compliance manager with the NHS. '),
(106, 'Deana Gibson', 'Sales Development Specialist My role at Elemental covers much of the sales acceleration process – from data intelligence to closing appointments. I take responsibility for building databases that are integral to successfully marketing relevant products or services or generating leads or appointments for our clients.  I also hit the phones and manage emails to convert leads to appointments, which is very satisfying part of the job. Every lead generation plan we write is different so there is a lot of variety in the type of audiences we engage with on a daily basis.  From an early age I realised my passion lied in the early stages of the sales; getting a consumer’s attention and turning that interest into a solid lead for a client. This has led to over a decade of sales and account management experience across accountancy, manufacturing, recruitment and most recently, health technology sectors. '),
(107, 'Carolanne Hart', 'Project Manager/Sales Development Specialist I lend my hand to all areas of Elemental’s business including data, marketing and business development.  My days are busy managing a team of technical support specialists and I am responsible for all aspects of this area including scheduling, customer liaison, scoping, project management, training and much, much more. This is a natural fit for me as I have a strong background in technical operations and call centre management.  My career highlight is managing the build and implementation of a UK accredited security operations centre, the first of its kind in India, for a major UK retailer.  '),
(108, 'Sallyann Smith', 'Head of Creative Services I head up all things design and creative at Elemental. I have over 20 years of design experience providing creative, practical and effective design and print solutions for a wide variety of clients.  I understand the importance of communications and I pride myself in having the creative ability and technical skills to work with clients and individuals to ensure that I achieve their objectives.  My aim is to exceed your expectations with quality of service, creative ability and dedication. '),
(109, 'Iona Spence-Dingle', 'Researcher and Data Quality Manager I help build and cleanse data and research projects – often vital to clients’ sales and marketing strategies – here at Elemental.  I am also a keen writer and produce features for online publications every week. As a person I am dedicated and passionate, I take great pride in my achievements and work. I love new challenges. I believe your never stop learning and relish the opportunity to expand my knowledge base.  '),
(110, 'Tara Athanasiou', 'Sales, Marketing and Intelligence With over twenty years of experience in the health, public sector and technology space and a track record in proposition development, new business development and all levels of marketing, Tara knows her stuff.  Her impressive CV boasts senior positions at major healthcare IT brands including Microsoft, Dr Foster, iSOFT, ReStart and Digital Health. During her time at Dr Foster, she created and delivered a flagship consumer healthcare and political affairs vehicle, the Hospital Guide, building a customer engagement portal, negotiating strategic partnerships and developing strategies to maximise customer retention.  Most recently, Tara was director of research and networks at Digital Health, where she was responsible for the delivery of the market intelligence service and the negotiation and management of strategic partnerships and affiliate marketing programmes. '),
(111, 'Dean Mawson', 'Clinical Consultant Dean is currently an independent clinical safety officer (CSO) working for both health organisations and healthcare IT suppliers supporting them in clinical safety management.  He has held a number of nursing positions in the NHS – including charge nurse, ward manager, admissions coordinator – before becoming a clinical lead for his trust’s EPR project, which ignited a passion for improving safety through technology.  Dean joined IMS MAXIMS, a leading healthcare IT supplier, playing an important role in the development, clinical safety management and delivery of a number of functional areas mainly focused on the acute setting. '),
(112, 'Mark Portlock', 'Sales Specialist Mark is a successful sales leader, with over 25 years’ experience and a history of exceeding sales targets, growing market share and improving profit margins. He has vast knowledge and a specialist understanding of the NHS and public sector marketplace and has built an impressive network of C-level contacts within the UK and across EMEA.  Having delivered significant new business for a large number of tier one system integrators, partners, and numerous specialist suppliers, he has an in-depth understanding of the public sector buying process. Companies approach Mark for strategic advice and delivery support for a variety of commercial activity including reviewing and redesigning sales processes, market entry plans, evaluation of market performance, sales appraisals, and much more. ');
